import React from "react";

function Row(){


    const imgstyle = {width: '100%'}
    const mystyle = {width: '80%', height: "300px", borderRadius: "21px 21px 0 0"}

    return(
        // <div class="d-md-flex flex-md-equal w-100 md-3 pl-md-3">
        // <div class="bg-dark mr-md-3 pt-3 px-3 pt-md-5 px-md-5 text-center text-white overflow-hidden">
        //     <div class="my-3 py-3">
        //     <h2 class="display-5">Nature Lovers' Club</h2>
        //     <p class="lead">Time: 9:00 AM to 5:00PM</p>
        //     </div>
        //     <div class="bg-light box-shadow mx-auto" style={mystyle}>
        //         <img style={imgstyle} src="./pic1.png"></img>
        //     </div>
        // </div>
        // <div class="bg-light mr-md-3 pt-3 px-3 pt-md-5 px-md-5 text-center overflow-hidden">
        //     <div class="my-3 p-3">
        //     <h2 class="display-5">Innovators Quest</h2>
        //     <p class="lead">Time: 7:00 PM</p>
        //     </div>
        //     <div class="bg-dark box-shadow mx-auto" style={mystyle}>
        //         <img style={imgstyle} src="./pic2.png"></img>
        //     </div>
        // </div>
        // </div>)


        <div id="carouselExampleRide" class="carousel slide" data-bs-ride="true">
        <div class="carousel-inner">
          <div class="carousel-item active">
            <img src="./pic1.png" class="d-block w-100" height="100%" />
          </div>
          <div class="carousel-item">
            <img src="./pic2.png" class="d-block w-100" height="100%" />
          </div>
          <div class="carousel-item">
            <img src="./pic3.png" class="d-block w-100" height="100%" />
          </div>
        </div>
        <button class="carousel-control-prev" type="button" data-bs-target="#carouselExampleRide" data-bs-slide="prev">
          <span class="carousel-control-prev-icon" aria-hidden="true"></span>
          <span class="visually-hidden">Previous</span>
        </button>
        <button class="carousel-control-next" type="button" data-bs-target="#carouselExampleRide" data-bs-slide="next">
          <span class="carousel-control-next-icon" aria-hidden="true"></span>
          <span class="visually-hidden">Next</span>
        </button>
      </div>
      )
}


export default Row;
